import React from "react";
import {
  DashboardContainer,
  DashboardHeaders,
  ShowTeam,
  TeamHeading,
  TeamIcon,
  FilterPokemon,
  SearchPokemon,
} from "./Dashboard";

const Dashboard = () => {
  return (
    <DashboardContainer>
      <DashboardHeaders>
        <ShowTeam>
          <TeamHeading>Team</TeamHeading>
          <TeamIcon />
        </ShowTeam>
        <FilterPokemon placeholder="show all filter..." />
        <SearchPokemon placeholder="search..." />
      </DashboardHeaders>
    </DashboardContainer>
  );
};

export default Dashboard;
